import Calendar from '../lib';

const App = () => (
  <div>
    <Calendar 
      onChange={(val) => {console.log(val)}}
      minDate={new Date('Jan 17 2018')}
      selectedDate={new Date('Jan 18 2018')}
      selectedMonth={new Date('Jan 18 2018')}
    />
  </div>
);

export default App;
